import Budget from "./Budget";
import Remaining from "./Remaining";
import Total from "./Total";
import { BudgetProvider } from "../context/budget-context";

const Manager = () => {
  return (
    <BudgetProvider>
      <Budget />
      <Total />
      <Remaining />
    </BudgetProvider>
  );
};

export default Manager;
